import React from "react";
import "./gallery.css";

export default function Gallery() {
  return (
    <div className="scrollmenu">
      <a className="galleryCard" href="#">
        <img src="" alt="" className="galleryCardPhoto" />
        <h3 className="galleryCardName">iPhone 13 Pro Max</h3>
        <p className="galleryCardPhoto">$9999999999999999999999999999</p>
      </a>
    </div>
  );
}
